Here is a simple example of a React, Node, and Express.js web app that creates, adds, and displays dummy data.

**Step 1: Create a new React app**

Run the following command in your terminal:
```bash
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the `my-app` directory, create a new file called `server.js`. Add the following code to this file:
```javascript
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const { name, age } = req.body;
  const id = data.length + 1;
  data.push({ id, name, age });
  res.json({ message: 'Data added successfully' });
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and has two endpoints: one to retrieve the dummy data and another to add new data.

**Step 3: Create a React component to display and add data**

In the `my-app` directory, create a new file called `DataComponent.js`. Add the following code to this file:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DataComponent = () => {
  const [data, setData] = useState([]);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');

  useEffect(() => {
    axios.get('http://localhost:3001/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('http://localhost:3001/api/data', { name, age })
      .then(response => {
        console.log(response.data);
        setData([...data, { id: data.length + 1, name, age }]);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" value={name} onChange={(event) => setName(event.target.value)} />
        </label>
        <label>
          Age:
          <input type="number" value={age} onChange={(event) => setAge(event.target.value)} />
        </label>
        <button type="submit">Add</button>
      </form>
    </div>
  );
};

export default DataComponent;
```
