You can use the `localeCompare` method to perform a case-insensitive sort in JavaScript. Here is an example:

```javascript
var arr = ['Zebra', 'zebra', 'apple', 'Apple', 'Banana', 'banana'];

arr.sort(function(a, b) {
  return a.toLowerCase().localeCompare(b.toLowerCase());
});

console.log(arr);
```

