Alternatively, you can use the `Intl.Collator` API to perform a case-insensitive sort:

```javascript
var arr = ['Zebra', 'zebra', 'apple', 'Apple', 'Banana', 'banana'];

var collator = new Intl.Collator('en', { sensitivity: 'base' });
arr.sort(collator.compare);

console.log(arr);
```

This will output the same result as the previous example.

