In this updated code, we've added a `variant` prop to the `Layout` component, which defaults to `'full-width'`. We've also defined an object `classes` that maps the variant names to the corresponding Tailwind CSS classes.

We then use the `variant` prop to conditionally apply the correct classes to the `div` element. The `p-20` class is always applied, regardless of the variant.

