Answer: 

To make the table headers clickable to sort the table rows without using jQuery or other plugins, you can use JavaScript and the `addEventListener` method to add a click event listener to each table header. Then, you can use the `Array.prototype.sort()` method to sort the table rows based on the clicked header.

Here is an example of how you can achieve this:

```javascript
// Get the table headers and rows
const tableHeaders = document.querySelectorAll('th');
const tableRows = document.querySelectorAll('tbody tr');

// Add a click event listener to each table header
tableHeaders.forEach((header, index) => {
  header.addEventListener('click', () => {
    // Get the column index of the clicked header
    const columnIndex = index;

    // Sort the table rows based on the clicked header
    const sortedRows = Array.prototype.slice.call(tableRows).sort((rowA, rowB) => {
      const cellA = rowA.cells[columnIndex].textContent;
      const cellB = rowB.cells[columnIndex].textContent;

      // Sort alphanumerically
      if (cellA < cellB) return -1;
      if (cellA > cellB) return 1;
      return 0;
    });

    // Update the table rows
    const tbody = document.querySelector('tbody');
    tbody.innerHTML = '';
    sortedRows.forEach((row) => {
      tbody.appendChild(row);
    });
  });
});
```

This code adds a click event listener to each table header. When a header is clicked, it sorts the table rows based on the clicked header and updates the table rows.

Note that this code assumes that the table headers and rows are direct children of the `thead` and `tbody` elements, respectively. If your table structure is different, you may need to modify the code accordingly.

Also, this code sorts the table rows alphanumerically, which means that it treats numbers as strings. If you want to sort the table rows numerically, you can modify the comparison function in the `sort()` method to use `parseInt()` or `parseFloat()` to convert the cell values to numbers.

